import React, { useState, useEffect } from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import Card from '../components/Card';
import './Home.css';

export default function Home() {

  const [search, setSearch] = useState('');
  const [foodCat, setFoodCat] = useState([]);
  const [foodItem, setFoodItem] = useState([]);
  const [filteredFoodItems, setFilteredFoodItems] = useState([]);

  const loadData = async () => {
    try {
      const response = await fetch("http://localhost:5226/api/Menu/GetAll", {
        method: "GET",
        headers: {
          'Content-Type': 'application/json'
        }
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      console.log('API Response:', data);

      // Set food items
      setFoodItem(data);
      setFilteredFoodItems(data);
      
      // Extract unique categories using categoryName from the API
      const uniqueCategories = [...new Set(data.map(item => item.categoryName))];
      console.log('Unique Categories:', uniqueCategories);
      
      // Transform categories to match your component's expected format
      const categoryData = uniqueCategories.filter(Boolean).map(categoryName => ({
        CategoryName: categoryName
      }));
      console.log('Category Data:', categoryData);
      
      setFoodCat(categoryData);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  useEffect(() => {
    loadData();
  }, []);

  useEffect(() => {
    if (search.trim() === '') {
      setFilteredFoodItems(foodItem);
    } else {
      const filteredItems = foodItem.filter(item =>
        item.name.toLowerCase().includes(search.toLowerCase())
      );
      setFilteredFoodItems(filteredItems);
    }
  }, [search, foodItem]);

  const filterItem = (category) => {
    if (category === "All") {
      setFilteredFoodItems(foodItem);
      return;
    }
    const updatedList = foodItem.filter((item) => item.categoryName === category);
    setFilteredFoodItems(updatedList);
  };

  return (
    <div>
      <div className="sticky-header-container">
      <Navbar />
      </div>

      <div>
        <div id="carouselExampleFade" className="carousel slide carousel-fade" data-bs-ride="carousel" style={{ objectFit: "contain !important" }}>

          <div className="carousel-inner" id='carousel' style={{ height: "100vh" }}>
            <div className='carousel-caption' style={{ zIndex: "9" }}>
              <div className="d-flex justify-content-center">
                <input
                  className="form-control me-2" 
                  type="search"
                  placeholder="Search"
                  style={{ width: '80%' }}
                  aria-label="Search"
                  value={search}
                  onChange={(e) => setSearch(e.target.value)}
                />
                <button className="btn btn-outline-success text-white bg-success" type="submit">Search</button>
              </div>
            </div>
            <div className="carousel-item active">
              <img src="data:image/jpeg;base64," className="d-block w-100" style={{ filter: "brightness(40%)" }} alt="..." />
            </div>
            <div className="carousel-item">
              <img src="data:image/jpeg;base64," className="d-block w-100" style={{ filter: "brightness(40%)" }} alt="..." />
            </div>
            <div className="carousel-item">
              <img src="data:image/jpeg;base64," className="d-block w-100" style={{ filter: "brightness(40%)" }} alt="..." />
            </div>
            <div className="carousel-item">
              <img src="data:image/jpeg;base64," className="d-block w-100" style={{ filter: "brightness(40%)" }} alt="..." />
            </div>
          </div>
          <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleFade" data-bs-slide="prev">
            <span className="carousel-control-prev-icon" aria-hidden="true"></span>
            <span className="visually-hidden">Previous</span>
          </button>
          <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleFade" data-bs-slide="next">
            <span className="carousel-control-next-icon" aria-hidden="true"></span>
            <span className="visually-hidden">Next</span>
          </button>
        </div>
      </div>  

      <div className='container'>
        {/* Category buttons */}
        <div className='row mb-3'>
          <div className='col-12 text-center'>
            <button 
              className='btn btn-outline-primary mx-2'
              onClick={() => filterItem('All')}
            >
              All
            </button>
            {foodCat.map((category) => (
              <button
                key={category.CategoryName}
                className='btn btn-outline-primary mx-2'
                onClick={() => filterItem(category.CategoryName)}
              >
                {category.CategoryName}
              </button>
            ))}
          </div>
        </div>

        {/* Food items display */}
        <div className='row'>
          {filteredFoodItems.length > 0 ? (
            filteredFoodItems.map((item) => (
              <div key={item.menuID} className='col-12 col-md-6 col-lg-3'>
                <Card 
                  foodItem={item}
                  options={{ regular: item.price }}
                />
              </div>
            ))
          ) : (
            <div className="col-12 text-center">
              <p>No items available</p>
            </div>
          )}
        </div>
      </div>

      <Footer />
    </div>
  );
}
